import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import IngredientListScreen from './screens/IngredientesScreen';
import IngredientFormScreen from './screens/abmIngredientesScreen';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="IngredientList"
          component={IngredientesScreen}
          options={{ title: 'Lista de Ingredientes' }}
        />
        <Stack.Screen
          name="IngredientForm"
          component={abmIngredientesScreen}
          options={{ title: 'ABM de Ingredientes' }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
